import React from 'react'
import ToDoItem from './components/ToDoItem'
import todoData from './components/todoData'

function App() {
	const tasksComponents = todoData.map(task => <ToDoItem key={task.id} text={task} />)
	return (
		<div className='todo-list'>
			{tasksComponents}
		</div>
	)
}

export default App
